    [],nt"num_tags": 4,nt"name": "sand-lake-wetland-management-district-annual-narrative-report-calendar-year-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Sand Lake WMD
    outlines Refuge accomplishments during the 1978 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, land acquisition activities, and the system status. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; croplands, grasslands,
    wetlands, forests, and easements for waterfowl management are discussed. The wildlife
    section of the report discusses endangered and threatened species, migratory birds,
    mammals, and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Cooperative programs, items of interest, and safety information are attached.",nt"owner_org":
